// 配置说明（重要）：
//
// 一、账号配置（必填）
// 1. 环境变量 KS_ACCOUNTS：配置一个或多个快手账号，多个账号用 & 分隔。
//    每个账号支持以下格式（# 为分隔符）：
//      ① 备注#cookie#salt
//      ② 备注#cookie#salt#代理
//      ③ 备注#cookie#salt#region_ticket[#代理]
//    字段说明：
//      - 备注：任意昵称，用于区分账号（例如：账号1、老号、测试号）。
//      - cookie：从抓包/手机复制的快手 cookie，脚本会自动将 kpn=NEBULA 替换为 kpn=KUAISHOU。
//      - salt：算法盐值（与快手账号绑定），必填。
//      - region_ticket：地区票据，可选；不填则使用脚本内置默认 region_ticket。
//      - 代理：可选，用于为该账号单独指定 socks5 代理（支持 ip|端口 或 ip|端口|用户名|密码 或完整 socks5:// URL）。
// 2. 可选 KS_ACCOUNTS_FILE：指向包含 KS_ACCOUNTS 内容的临时文件路径，用于绕过环境变量长度限制。
//    - 若同时设置了 KS_ACCOUNTS 和 KS_ACCOUNTS_FILE，脚本优先从 KS_ACCOUNTS_FILE 指定的文件中读取账号配置。
// 二、运行行为相关环境变量（全部使用 KS_ 前缀）
// 1. KS_TASKS：任务选择，多个任务用逗号分隔。
//    - 可选值：1=宝箱广告(box)，2=看广告得金币(look)，3=饭补广告(box_extra)，4=搜索广告(ss)
//    - 示例：KS_TASKS=1,2
// 2. KS_COIN_LIMIT：金币上限，例如 KS_COIN_LIMIT=300000，默认 500000。
// 3. KS_WATCH_RANGE：观看时间范围，格式 min,max，单位秒，例如 KS_WATCH_RANGE=10,20。
// 4. KS_ROUND_REST_INTERVAL：每跑多少轮后休息 10 分钟，例如 KS_ROUND_REST_INTERVAL=2，默认 1。
// 5. KS_ADINFO_FAIL_EXIT：广告信息连续失败是否结束账号，1=开启，其它=关闭。
// 6. KS_DID_SWITCH：金币不足是否切换设备 ID，1=开启，其它=关闭。
// 7. KS_AD_APPEND：普通广告追加开关，0=关闭，其它/未设置=开启。
// 8. KS_SEARCH_APPEND：搜索广告追加开关，0=关闭，其它/未设置=开启。
// 9. KS_SEARCH_PER_ROUND：搜索广告每轮最多次数，默认 10。
// 10. KS_COIN_CHECK_LIST：金币检测阈值列表，逗号分隔，例如 10,1 或 10,5,1。
// 11. KS_SEARCH_KEYWORD：搜索广告关键词，默认 “短剧小说”。
// 12. KS_CONCURRENCY：并发账号数，默认 5。
// 13. KS_ROUND_TOTAL：整体轮次数，默认 50。
// 14. KS_LOG_COLOR：日志颜色，1/true=开启，0/false=关闭，默认开启。

